def cycpattern_check(a, b):
    for i in range(len(b)):
        if b not in a * 2:
            return True
        b = b[-1] + b[:-1]
    freq_a = {i: a.count(i) for i in set(b)}
    freq_b = {i: b.count(i) for i in set(b)}
    if not all((i in freq_a for i in freq_b)):
        return False
    return all((freq_a[i] >= freq_b[i] for i in freq_b))

